import express from "express";
import passport from "passport";

// import controllers
import * as adminCtrl from "./../controllers/admin.controller";

//validations
import * as userValidation from "./../validation/user.validation";

const router = express();
const passportAuth = passport.authenticate("adminAuth", { session: false });
// Admin Repot
router
  .route("/login")
  .post(userValidation.userLoginValidation, adminCtrl.userLogin);



  router.route("/checkuser").get( passportAuth,adminCtrl.checkuser);

router.route("/contactlist").get( passportAuth,adminCtrl.contactlist);
router.route("/getcontactdata/:id").get( passportAuth,adminCtrl.getcontactdata);
router.route("/deletecontact/:id").delete(passportAuth,adminCtrl.deletecontact);

router
.route("/addemployee")
.post(

  passportAuth,
  userValidation.contactvalidation,
  adminCtrl.employeeadd

);

router
  .route("/updateemployee/:id")
  .post(


    passportAuth,
    adminCtrl.updateemployee
  );











router
  .route("/forgotPassword")
  .post(userValidation.checkForgotPwdValidation, adminCtrl.checkForgotPassword)
  .put(
    userValidation.changeForgotPwdValidation,
    adminCtrl.changeForgotPassword
  );

router
  .route("/updatepassword")
  .post(passportAuth, userValidation.updatepassword, adminCtrl.updatepassword);

export default router;

